body {
  font-family: SF Mono, sans-serif;
  margin:0;
  padding:0;
  line-height: 1.5;
}

.layout {
  margin: 0 auto;
}

.header {
  display: flex;
  align-items: center;
  margin-bottom: 20px;
  height: 80px;
  max-width: 1500px;
  margin:auto;
  padding-left:50px;
  padding-right:50px;
  position:absolute;
}

.logo_bcn
{
width:150px;
}

.nav__link {
  margin-left: 20px;
  color:#5a5a5a;
  text-decoration:none;
}
.nav__link:hover {
  margin-left: 20px;
  color:#0000ff;
  text-decoration:none;
}

.getting-started:hover {
  color:#fff;
  text-decoration:none;
}

.main-nav
{

  margin-left:50px;
}
.app-nav
{
margin-left:auto;
}

.getting-started
{
  box-sizing:border-box;
  background-color:#0000ff;
  border-radius:50px;
  min-height: 52px;
  padding-top:20px;
  padding-bottom:20px;
  padding-right: 30px;
  padding-left: 30px;
  color:#fff;
  transition:all ease-in .2s;
  border:#0000ff solid 1.5px;
}
.getting-started:hover
{

  border:#0000ff solid 1.5px;
  background-color:#fff;
  color:#0000ff;
  transition:all ease-in .2s;
}
